    const description=info.substring(0,200);




    return(
        <div className="card">
            <img src={image}></img>
            <div className="tour-details">
                <h4 className="tour-price">{price}</h4>
                <h4 className="tour-name">{name}</h4>
            </div>

            <div className="description">
                {info.subscript}
            </div>

        </div>

    );

}
export default Card;
